import React from 'react'
import api from '../api'
const Indexpage = () => {
    // Create state variables
    let [responseData, setResponseData] = React.useState('')
    // fetches data
    const fetchData = (e) => {
        e.preventDefault()
        api.getData()
        .then((response)=>{
            setResponseData(response.data)
            console.log(response)
        })
        .catch((error) => {
            console.log(error)
        })
    }
    return (
        <div>
            
            <h1>{responseData.productname}</h1>
            <img src={responseData.selectedfile} alt="no img"/>
            <button onClick={(e) => fetchData(e)} type='button'>Click Me For Data</button>
            {responseData&& responseData.dates.map(date => {
                return <p>{date}</p>
            })}
        </div>
    )
}
export default Indexpage;
